import React, { useState, useEffect, useRef } from 'react';
import { Preferences } from '@capacitor/preferences';
import { AdMob, InterstitialAdPluginEvents } from '@capacitor-community/admob';


export default function BobaRush() {
  const [gameState, setGameState] = useState('start');
  const [isPaused, setIsPaused] = useState(false);
  const [drinkPosition, setDrinkPosition] = useState(50);
  const [pearls, setPearls] = useState([]);
  const [score, setScore] = useState(0);
  const [level, setLevel] = useState(1);
  const [showLevelUp, setShowLevelUp] = useState(false);
  const [highScore, setHighScore] = useState(0);
  const [soundEnabled, setSoundEnabled] = useState(true);
  const [showAd, setShowAd] = useState(false);
  const [adCountdown, setAdCountdown] = useState(5);
  const [savedGameState, setSavedGameState] = useState(null);
  
  const gameAreaRef = useRef(null);
  const touchStartX = useRef(null);
  const lastPearlId = useRef(0);
  const animationFrameRef = useRef(null);
  const lastSpawnTime = useRef(0);
  const audioContextRef = useRef(null);
  const musicIntervalRef = useRef(null);

  const DRINK_WIDTH = 100;
  const PEARL_SIZE = 30;
  const BASE_FALL_SPEED = 2;
  const BASE_SPAWN_RATE = 1000;
  const PEARLS_PER_LEVEL = 10;
  
  const PEARL_IMAGES = ["data:image/png;base64,", "data:image/png;base64,", "data:image/png;base64,"];
  const DRINK_IMAGE = "data:image/png;base64,";

  // Initialize Web Audio API
  useEffect(() => {
    audioContextRef.current = new (window.AudioContext || window.webkitAudioContext)();
    return () => {
      if (musicIntervalRef.current) {
        clearInterval(musicIntervalRef.current);
      }
      if (audioContextRef.current) {
        audioContextRef.current.close();
      }
    };
  }, []);

  // Ad countdown timer
  useEffect(() => {
    if (showAd && adCountdown > 0) {
      const timer = setTimeout(() => setAdCountdown(adCountdown - 1), 1000);
      return () => clearTimeout(timer);
    } else if (showAd && adCountdown === 0) {
      // Countdown finished, show the ad
      loadAndShowInterstitialAd();
    }
  }, [showAd, adCountdown]);

  useEffect(() => {
  const loadHighScore = async () => {
    try {
      const { value } = await Preferences.get({ key: 'highScore' });
      if (value) {
        setHighScore(parseInt(value));
      }
    } catch (error) {
      console.log('No saved high score yet');
    }
  };
  loadHighScore();
}, []);

  useEffect(() => {
    const initializeAdMob = async () => {
      try {
        await AdMob.initialize({
          requestTrackingAuthorization: true,
        });
        console.log('AdMob initialized successfully');
      } catch (error) {
        console.error('AdMob initialization failed:', error);
      }
    };
    initializeAdMob();
  }, []);

  useEffect(() => {
    const listener = AdMob.addListener(
      InterstitialAdPluginEvents.Dismissed,
      () => {
        console.log('Ad was dismissed by user');
        // Don't hide showAd - we want to show continue/end buttons
        // Just reset the countdown so buttons appear
        setAdCountdown(0);
      }
    );
    
    return () => {
      listener.remove();
    };
  }, []);

  // Play catch sound effect
  const playCatchSound = () => {
    if (!soundEnabled || !audioContextRef.current) return;
    
    const ctx = audioContextRef.current;
    const oscillator = ctx.createOscillator();
    const gainNode = ctx.createGain();
    
    oscillator.connect(gainNode);
    gainNode.connect(ctx.destination);
    
    oscillator.frequency.setValueAtTime(800, ctx.currentTime);
    oscillator.frequency.exponentialRampToValueAtTime(1200, ctx.currentTime + 0.1);
    
    gainNode.gain.setValueAtTime(0.3, ctx.currentTime);
    gainNode.gain.exponentialRampToValueAtTime(0.01, ctx.currentTime + 0.2);
    
    oscillator.start(ctx.currentTime);
    oscillator.stop(ctx.currentTime + 0.2);
  };

  // Play losing sound effect
  const playLoseSound = () => {
    if (!soundEnabled || !audioContextRef.current) return;
    
    const ctx = audioContextRef.current;
    const osc = ctx.createOscillator();
    const gain = ctx.createGain();
    
    osc.connect(gain);
    gain.connect(ctx.destination);
    
    osc.type = 'sine';
    osc.frequency.setValueAtTime(400, ctx.currentTime);
    osc.frequency.exponentialRampToValueAtTime(200, ctx.currentTime + 0.5);
    
    gain.gain.setValueAtTime(0.2, ctx.currentTime);
    gain.gain.exponentialRampToValueAtTime(0.01, ctx.currentTime + 0.5);
    
    osc.start(ctx.currentTime);
    osc.stop(ctx.currentTime + 0.5);
  };

  // Background music
  const startBackgroundMusic = () => {
    if (!soundEnabled || !audioContextRef.current || musicIntervalRef.current) return;
    
    const ctx = audioContextRef.current;
    
    const playNote = (frequency, duration) => {
      const osc = ctx.createOscillator();
      const gain = ctx.createGain();
      
      osc.type = 'sine';
      osc.frequency.value = frequency;
      
      gain.gain.setValueAtTime(0.04, ctx.currentTime);
      gain.gain.exponentialRampToValueAtTime(0.001, ctx.currentTime + duration);
      
      osc.connect(gain);
      gain.connect(ctx.destination);
      
      osc.start(ctx.currentTime);
      osc.stop(ctx.currentTime + duration);
    };
    
    const melody = [
      { note: 523.25, duration: 0.6 }, { note: 587.33, duration: 0.6 },
      { note: 659.25, duration: 0.6 }, { note: 523.25, duration: 0.6 },
      { note: 659.25, duration: 0.6 }, { note: 587.33, duration: 0.6 },
      { note: 523.25, duration: 1.2 }, { note: 392.00, duration: 1.2 },
      { note: 440.00, duration: 0.6 }, { note: 493.88, duration: 0.6 },
      { note: 523.25, duration: 0.6 }, { note: 587.33, duration: 0.6 },
      { note: 659.25, duration: 1.2 }, { note: 587.33, duration: 0.6 },
      { note: 523.25, duration: 1.2 }, { note: 440.00, duration: 1.2 },
      { note: 587.33, duration: 0.6 }, { note: 659.25, duration: 0.6 },
      { note: 783.99, duration: 0.6 }, { note: 659.25, duration: 0.6 },
      { note: 587.33, duration: 0.6 }, { note: 523.25, duration: 0.6 },
      { note: 493.88, duration: 1.2 }, { note: 392.00, duration: 1.2 },
      { note: 523.25, duration: 0.6 }, { note: 659.25, duration: 0.6 },
      { note: 587.33, duration: 0.6 }, { note: 523.25, duration: 0.6 },
      { note: 440.00, duration: 1.2 }, { note: 392.00, duration: 1.2 },
      { note: 523.25, duration: 2.4 }, { note: 0, duration: 1.2 },
    ];
    
    let noteIndex = 0;
    const playNextNote = () => {
      if (!soundEnabled) return;
      if (melody[noteIndex].note > 0) {
        playNote(melody[noteIndex].note, melody[noteIndex].duration);
      }
      noteIndex = (noteIndex + 1) % melody.length;
    };
    
    playNextNote();
    musicIntervalRef.current = setInterval(playNextNote, 600);
  };

  const stopBackgroundMusic = () => {
    if (musicIntervalRef.current) {
      clearInterval(musicIntervalRef.current);
      musicIntervalRef.current = null;
    }
  };

  const toggleSound = () => {
    setSoundEnabled(prev => !prev);
  };

  const togglePause = () => {
    if (gameState === 'playing') {
      setGameState('paused');
      setIsPaused(true);
      stopBackgroundMusic();
    } else if (gameState === 'paused') {
      setGameState('playing');
      setIsPaused(false);
      if (soundEnabled) {
        startBackgroundMusic();
      }
    }
  };

  useEffect(() => {
    if (gameState === 'playing') {
      if (soundEnabled) {
        startBackgroundMusic();
      } else {
        stopBackgroundMusic();
      }
    }
    return () => {
      if (!soundEnabled) {
        stopBackgroundMusic();
      }
    };
  }, [soundEnabled, gameState]);

  const getFallSpeed = () => BASE_FALL_SPEED + (level - 1) * 0.5;
  const getSpawnRate = () => Math.max(400, BASE_SPAWN_RATE - (level - 1) * 80);

const startGame = () => {
  setGameState('playing');
  setScore(0);
  setLevel(1);
  setPearls([]);
  setDrinkPosition(50);
  lastSpawnTime.current = Date.now();
  setSavedGameState(null);
  setShowAd(false); // ADD THIS LINE
  setAdCountdown(5); // ADD THIS LINE
};

  const continueGame = () => {
    if (savedGameState) {
      setGameState('playing');
      setScore(savedGameState.score);
      setLevel(savedGameState.level);
      setDrinkPosition(savedGameState.drinkPosition);
      setPearls([]);
      lastSpawnTime.current = Date.now();
      setShowAd(false);
      setAdCountdown(5);
      setSavedGameState(null);
    }
  };

    const endGame = async () => {
      const newHighScore = Math.max(highScore, score);
      setHighScore(newHighScore);
      try {
        await Preferences.set({ key: 'highScore', value: newHighScore.toString() });
      } catch (err) {
        console.error('Failed to save high score:', err);
      }
      setGameState('start');
      setShowAd(false);
      setAdCountdown(5);
      setSavedGameState(null);
  };

  const spawnPearl = () => {
    const randomPearlImage = PEARL_IMAGES[Math.floor(Math.random() * PEARL_IMAGES.length)];
    
    const newPearl = {
      id: ++lastPearlId.current,
      x: Math.random() * 85 + 5,
      y: -PEARL_SIZE,
      caught: false,
      image: randomPearlImage
    };
    
    setPearls(prev => [...prev, newPearl]);
  };

  useEffect(() => {
    if (gameState !== 'playing') return;

    const gameLoop = (timestamp) => {
      const gameArea = gameAreaRef.current;
      if (!gameArea) return;

      const now = Date.now();
      if (now - lastSpawnTime.current > getSpawnRate()) {
        spawnPearl();
        lastSpawnTime.current = now;
      }

      setPearls(prev => {
        const gameHeight = gameArea.clientHeight;
        const gameWidth = gameArea.clientWidth;
        const fallSpeed = getFallSpeed();
        
        const drinkLeft = (drinkPosition / 100) * gameWidth - DRINK_WIDTH / 2;
        const drinkRight = drinkLeft + DRINK_WIDTH;
        const drinkTop = gameHeight - 120;

        let newPearls = [];
        let missedPearl = false;
        let caughtPearl = false;

        for (let pearl of prev) {
          if (pearl.caught) continue;

          const newY = pearl.y + fallSpeed;
          const pearlLeft = (pearl.x / 100) * gameWidth;
          const pearlRight = pearlLeft + PEARL_SIZE;
          const pearlBottom = newY + PEARL_SIZE;

          if (newY < drinkTop + 40 && pearlBottom > drinkTop &&
              pearlRight > drinkLeft && pearlLeft < drinkRight) {
            caughtPearl = true;
            setScore(s => {
              const newScore = s + 1;
              if (newScore % PEARLS_PER_LEVEL === 0) {
                setLevel(l => l + 1);
                setShowLevelUp(true);
                setTimeout(() => setShowLevelUp(false), 1500);
              }
              return newScore;
            });
            continue;
          }

          if (newY > gameHeight) {
            missedPearl = true;
            continue;
          }

          newPearls.push({ ...pearl, y: newY });
        }

        if (caughtPearl) {
          playCatchSound();
        }

      if (missedPearl) {
        playLoseSound();
        setSavedGameState({ score, level, drinkPosition });
        
        // Save high score
        const newHighScore = Math.max(highScore, score);
        setHighScore(newHighScore);
        Preferences.set({ key: 'highScore', value: newHighScore.toString() }).catch(err => {
          console.error('Failed to save high score:', err);
        });
        
        setShowAd(true);
        setGameState('gameOver');
        stopBackgroundMusic();
        
        // Start 5 second countdown before showing ad
        setAdCountdown(5);
      }

        return newPearls;
      });

      animationFrameRef.current = requestAnimationFrame(gameLoop);
    };

    animationFrameRef.current = requestAnimationFrame(gameLoop);

    return () => {
      if (animationFrameRef.current) {
        cancelAnimationFrame(animationFrameRef.current);
      }
    };
  }, [gameState, drinkPosition, level, score]);

  const handleTouchStart = (e) => {
    touchStartX.current = e.touches[0].clientX;
  };

  const handleTouchMove = (e) => {
    if (touchStartX.current === null || !gameAreaRef.current) return;
    
    const currentX = e.touches[0].clientX;
    const gameWidth = gameAreaRef.current.clientWidth;
    const newPosition = (currentX / gameWidth) * 100;
    
    setDrinkPosition(Math.max(10, Math.min(90, newPosition)));
  };

  const handleTouchEnd = () => {
    touchStartX.current = null;
  };

  const handleMouseDown = (e) => {
    touchStartX.current = e.clientX;
  };

  const handleMouseMove = (e) => {
    if (touchStartX.current === null || !gameAreaRef.current) return;
    
    const gameWidth = gameAreaRef.current.clientWidth;
    const newPosition = (e.clientX / gameWidth) * 100;
    
    setDrinkPosition(Math.max(10, Math.min(90, newPosition)));
  };

  const handleMouseUp = () => {
    touchStartX.current = null;
  };

  const loadAndShowInterstitialAd = async () => {
    try {
      console.log('=== STARTING AD LOAD ===');
      console.log('Preparing interstitial ad...');
      
      const options = {
        adId: 'ca-app-pub-9841742295978516/9107747830',
      };
      
      console.log('Ad options:', options);
      
      await AdMob.prepareInterstitial(options);
      
      console.log('Ad prepared successfully!');
      console.log('Showing interstitial ad...');
      
      await AdMob.showInterstitial();
      
      console.log('Ad show command sent!');
      
    } catch (error) {
      console.error('=== AD ERROR ===');
      console.error('Error type:', error);
      console.error('Error message:', error.message);
      console.error('Error stack:', error.stack);
      
      // Skip ad on failure
      setShowAd(false);
    }
  };

  return (
    <div className="w-full h-screen bg-gradient-to-b from-pink-100 to-purple-100 flex flex-col items-center justify-center overflow-hidden">
      {gameState === 'start' && (
        <div className="text-center p-8 bg-white rounded-3xl shadow-2xl max-w-md mx-4">
          <h1 className="text-5xl font-bold text-pink-500 mb-4"> Boba Rush</h1>
          <p className="text-gray-700 mb-6 text-lg">Swipe to catch falling boba pearls!</p>

          {highScore > 0 && (
            <p className="text-gray-600 mb-4">High Score: {highScore}</p>
          )}
          
          <button
            onClick={startGame}
            className="w-full bg-gradient-to-r from-pink-500 to-purple-500 text-white font-bold py-4 px-8 rounded-full text-xl shadow-lg hover:shadow-xl transform hover:scale-105 transition"
          >
            Start Game
          </button>
        </div>
      )}

      {gameState === 'playing' && (
        <div
          ref={gameAreaRef}
          className="relative w-full h-full bg-gradient-to-b from-sky-200 to-pink-200"
          onTouchStart={handleTouchStart}
          onTouchMove={handleTouchMove}
          onTouchEnd={handleTouchEnd}
          onMouseDown={handleMouseDown}
          onMouseMove={handleMouseMove}
          onMouseUp={handleMouseUp}
          onMouseLeave={handleMouseUp}
        >
          <button
            onClick={toggleSound}
            className="absolute top-16 right-4 z-30 bg-white/80 backdrop-blur-sm rounded-full p-3 shadow-lg hover:bg-white transition"
            aria-label="Toggle sound"
          >
            {soundEnabled ? (
              <svg className="w-6 h-6 text-purple-600" fill="currentColor" viewBox="0 0 20 20">
                <path fillRule="evenodd" d="M9.383 3.076A1 1 0 0110 4v12a1 1 0 01-1.707.707L4.586 13H2a1 1 0 01-1-1V8a1 1 0 011-1h2.586l3.707-3.707a1 1 0 011.09-.217zM14.657 2.929a1 1 0 011.414 0A9.972 9.972 0 0119 10a9.972 9.972 0 01-2.929 7.071 1 1 0 01-1.414-1.414A7.971 7.971 0 0017 10c0-2.21-.894-4.208-2.343-5.657a1 1 0 010-1.414zm-2.829 2.828a1 1 0 011.415 0A5.983 5.983 0 0115 10a5.984 5.984 0 01-1.757 4.243 1 1 0 01-1.415-1.415A3.984 3.984 0 0013 10a3.983 3.983 0 00-1.172-2.828 1 1 0 010-1.415z" clipRule="evenodd" />
              </svg>
            ) : (
              <svg className="w-6 h-6 text-gray-400" fill="currentColor" viewBox="0 0 20 20">
                <path fillRule="evenodd" d="M9.383 3.076A1 1 0 0110 4v12a1 1 0 01-1.707.707L4.586 13H2a1 1 0 01-1-1V8a1 1 0 011-1h2.586l3.707-3.707a1 1 0 011.09-.217zM12.293 7.293a1 1 0 011.414 0L15 8.586l1.293-1.293a1 1 0 111.414 1.414L16.414 10l1.293 1.293a1 1 0 01-1.414 1.414L15 11.414l-1.293 1.293a1 1 0 01-1.414-1.414L13.586 10l-1.293-1.293a1 1 0 010-1.414z" clipRule="evenodd" />
              </svg>
            )}
          </button>

          <button
            onClick={togglePause}
            className="absolute top-16 right-20 z-30 bg-white/80 backdrop-blur-sm rounded-full p-3 shadow-lg hover:bg-white transition"
            aria-label="Pause game"
          >
            <svg className="w-6 h-6 text-purple-600" fill="currentColor" viewBox="0 0 20 20">
              <path fillRule="evenodd" d="M18 10a8 8 0 11-16 0 8 8 0 0116 0zM7 8a1 1 0 012 0v4a1 1 0 11-2 0V8zm5-1a1 1 0 00-1 1v4a1 1 0 102 0V8a1 1 0 00-1-1z" clipRule="evenodd" />
            </svg>
          </button>

          <div className="absolute top-16 left-0 right-0 flex justify-between px-6 z-20">
            <div className="bg-white/80 backdrop-blur-sm rounded-full px-2 py-2 shadow-lg">
              <div className="flex flex-col items-center">
                <span className="text-sm font-semibold text-purple-600">Score</span>
                <span className="text-sm font-bold text-purple-600">{score}</span>
              </div>
            </div>

          <div className="bg-white/80 backdrop-blur-sm rounded-full px-2 py-2 shadow-lg">
            <div className="flex flex-col items-center">
              <span className="text-sm font-semibold text-yellow-600">High Score</span>
              <span className="text-sm font-bold text-yellow-600">{highScore}</span>
            </div>
          </div>

            <div className="bg-white/80 backdrop-blur-sm rounded-full px-2 py-2 shadow-lg mr-28">
              <div className="flex flex-col items-center">
                <span className="text-sm font-semibold text-pink-600">Level</span>
                <span className="text-sm font-bold text-pink-600">{level}</span>
              </div>
            </div>
          </div>

          {showLevelUp && (
            <div className="absolute top-1/3 left-1/2 transform -translate-x-1/2 -translate-y-1/2 z-30 animate-bounce">
              <div className="bg-gradient-to-r from-yellow-400 to-orange-400 text-white font-bold py-3 px-6 rounded-full shadow-2xl text-xl">
                Level {level}!
              </div>
            </div>
          )}

          {pearls.map(pearl => (
            <div
              key={pearl.id}
              className="absolute"
              style={{
                left: `${pearl.x}%`,
                top: `${pearl.y}px`,
                width: `${PEARL_SIZE}px`,
                height: `${PEARL_SIZE}px`,
              }}
            >
              <img
                src={pearl.image}
                alt="pearl"
                className="w-full h-full object-contain"
                draggable="false"
              />
            </div>
          ))}

          <div
            className="absolute bottom-8 transform -translate-x-1/2"
            style={{
              left: `${drinkPosition}%`,
              width: `${DRINK_WIDTH}px`,
              height: '120px',
            }}
          >
            <img
              src={DRINK_IMAGE}
              alt="boba drink"
              className="w-full h-full object-contain"
              draggable="false"
            />
          </div>
        </div>
      )}

      {gameState === 'paused' && (
        <div className="absolute inset-0 bg-black/60 flex items-center justify-center z-50">
          <div className="bg-white rounded-3xl p-8 text-center shadow-2xl max-w-sm mx-4">
            <h2 className="text-4xl font-bold text-purple-600 mb-6"> Paused</h2>
            <div className="space-y-4">
              <button
                onClick={togglePause}
                className="w-full bg-gradient-to-r from-pink-500 to-purple-500 text-white font-bold py-4 px-8 rounded-full text-xl shadow-lg hover:shadow-xl transform hover:scale-105 transition"
              >
                Resume
              </button>
              <button
                onClick={() => {
                  setGameState('start');
                  stopBackgroundMusic();
                }}
                className="w-full bg-gray-300 text-gray-700 font-bold py-3 px-6 rounded-full text-lg shadow-lg hover:bg-gray-400 transition"
              >
                Quit to Menu
              </button>
            </div>
          </div>
        </div>
      )}

  {gameState === 'gameOver' && showAd && (
      <div className="text-center p-8 bg-white rounded-3xl shadow-2xl max-w-md mx-4">
        <h2 className="text-3xl font-bold text-orange-500 mb-4">Oh No!</h2>
        <p className="text-xl text-gray-700 mb-2">Score: {score}</p>
        <p className="text-lg text-gray-600 mb-6">Level: {level}</p>
        
        {adCountdown > 0 ? (
          <>
            <div className="bg-purple-100 rounded-lg p-6 mb-6">
              <p className="text-lg text-gray-700 mb-2">Watch an ad to continue?</p>
              <p className="text-4xl font-bold text-purple-600">{adCountdown}s</p>
              <p className="text-sm text-gray-500 mt-2">Ad will show automatically...</p>
            </div>
            
            <button
              onClick={endGame}
              className="w-full bg-gray-200 text-gray-700 font-semibold py-3 px-8 rounded-full text-lg hover:bg-gray-300 transition"
            >
              Skip - End Game
            </button>
          </>
        ) : (
          <>
            <p className="text-gray-500 mb-6 italic">Showing ad...</p>
            
            <div className="space-y-3">
              <button
                onClick={continueGame}
                className="w-full bg-gradient-to-r from-green-500 to-emerald-500 text-white font-bold py-4 px-8 rounded-full text-xl shadow-lg hover:shadow-xl transform hover:scale-105 transition"
              >
                 Continue Playing
              </button>
              
              <button
                onClick={endGame}
                className="w-full bg-gray-200 text-gray-700 font-semibold py-3 px-8 rounded-full text-lg hover:bg-gray-300 transition"
              >
                End Game
              </button>
            </div>
          </>
        )}
      </div>
    )}

      {gameState === 'gameOver' && !showAd && (
        <div className="text-center p-8 bg-white rounded-3xl shadow-2xl max-w-md mx-4">
          <h2 className="text-4xl font-bold text-red-500 mb-4">Game Over!</h2>
          <p className="text-2xl text-gray-700 mb-2">Score: {score}</p>
          <p className="text-xl text-gray-600 mb-4">Level: {level}</p>
          {score === highScore && score > 0 && (
            <p className="text-lg text-yellow-600 font-bold mb-4"> New High Score! </p>
          )}
          {highScore > 0 && score !== highScore && (
            <p className="text-gray-600 mb-4">High Score: {highScore}</p>
          )}
          <button
            onClick={startGame}
            className="w-full bg-gradient-to-r from-pink-500 to-purple-500 text-white font-bold py-4 px-8 rounded-full text-xl shadow-lg hover:shadow-xl transform hover:scale-105 transition"
          >
            Play Again
          </button>
        </div>
      )}
    </div>
  );
}